import React, { useState } from 'react';
import EmployeeDetails from './view';
import { Link, useNavigate } from 'react-router-dom';

const List = ({ employees, handleEdit, handleDelete }) => {
  const navigate = useNavigate();
  const [selectedEmployee, setSelectedEmployee] = useState(null);

  const handleGetDetails = (employee) => {
    console.log(employee);
    setSelectedEmployee(employee);
    navigate('/view/' + employee.id);
  };

  const handleCloseDetails = () => {
    setSelectedEmployee(null);
  };
  return (
    <>
      {selectedEmployee ? (
        <EmployeeDetails
          employee={selectedEmployee}
          onCloseDetails={handleCloseDetails}
        />
      ) : (
        <div className='contain-table'>
          <h1>List of Employees</h1>
          <table className='striped-table'>
            <thead>
              <tr>
                <th>Emp-ID</th>
                <th>First Name</th>
                <th>Last Name</th>
                <th>Email</th>
                <th colSpan={3} className='text-center'>
                  Actions
                </th>
              </tr>
            </thead>
            <tbody>
              {employees?.length > 0 ? (
                employees.map((employee, i) => (
                  <tr key={employee.id}>
                    <td>EMP_{i + 1}</td>
                    <td>{employee.firstName}</td>
                    <td>{employee.lastName}</td>
                    <td>{employee.email}</td>
                    <td className='text-right'>
                      <button
                        id='view'
                        onClick={(e) => {
                          e.preventDefault();
                          handleGetDetails(employee);
                        }}
                        className='button muted-button'
                      >
                        View
                      </button>
                    </td>

                    <td className='text-right'>
                      <button
                        id='edit'
                        onClick={() => handleEdit(employee.id)}
                        className='button muted-button'
                      >
                        Edit
                      </button>
                    </td>
                    <td className='text-left'>
                      <button
                        id='delete'
                        onClick={() => handleDelete(employee.id)}
                        className='button muted-button'
                      >
                        Delete
                      </button>
                    </td>
                  </tr>
                ))
              ) : (
                <tr>
                  <td colSpan={7}>No Employees</td>
                </tr>
              )}
            </tbody>
          </table>

          {selectedEmployee && (
            <div className='employee-details'>
              <h2>Employee Details</h2>
              <p>
                <strong>ID:</strong> {selectedEmployee.id}
              </p>
              <p>
                <strong>First Name:</strong> {selectedEmployee.firstName}
              </p>
              <p>
                <strong>Last Name:</strong> {selectedEmployee.lastName}
              </p>
              <p>
                <strong>Email:</strong> {selectedEmployee.email}
              </p>
              {/* Add other details as needed */}
              <button
                className='button muted-button'
                onClick={() => setSelectedEmployee(null)}
              >
                Close Details
              </button>
            </div>
          )}
        </div>
      )}
    </>
  );
};

export default List;
